--[[
:序号
dwID:id编号
dwNameID:名称:技能名字
dwSkilExplain1:技能逻辑说明:技能效果说明：
如：对目标造成XX伤害并附加XX效果
dwSkilExplain2:技能的历史说明:技能的历史描述：如XXX高手在XX年创造的该套武功，牛B
dwStudentDes:技能学习描述:作者:
技能面板选中未学习技能设时的引导描述
szIcon:已学习图标:技能面板中已学会该技能时的图标
szGrayIcon:未学习图标:技能面板中未学会该技能时的图标
dwSkillKinds:技能种类:1：招式 （主动）
2：内功 （开启）
3：心法 （被动）

dwSkillType:技能类型:作者:
<技能类型>（10进制累加）
技能效果
0：没有效果
1：主动使用生效（脚本下的skill_active_effect函数）
10：被动使用生效（脚本中XXX函数）
100：开启状态生效（脚本中XXXX函数）

dwLimitItem:装备限制:0 不需要装备武器
1 需要装备武器
dwIfLvAdd:技能等级是否收到其他加成:如境界系统会提升技能等级。这个字段就是增加判断。判定是否增加这个技能的技能等级。
0：会
1：不会

dwIfNeigongEffect:是否受到内功效果加成:作者:
<是否受到内功效果加成>
0：会
1：不会

dwPlayerTurn:技能释放是否会自动转身:作者:
<技能释放是否会自动转身>
释放该技能的时候，角色是否根据释放方向转身
0：会
1：不会

dwRangeType:区域选择:作者:
0：单体
1：自身群_扇形（圆360°）
2：目标群_扇形（圆360°）
3：线性_矩形
4：动态矩形（根据移动距离计算）
5：跳跃技能不受选中目标影响
dwIFMustTarget:是否必须目标:作者:
范围技能释放时，判断是否必须目标
0：否
1：是

dwSkillTarget:目标类型:作者:
<技能释放目标类型：（10进制累加）>
0：自身为目标（单体技能）/所有目标（范围技能）
1：自己
10：友方
100：敌方
玩家释放技能时，需要断角色当前选中状态是否满足技能的释放条件。

dwDistance:释放距离:<释放距离>
玩家与选中目标之间的距离不大于distance才能施放技能。（否则，玩家自动移动到离自己当前位置最近且与目标距离等于distance的位置再使用技能）
fRangeX:影响范围X:<影响范围X>
单体：技能有效范围
扇形：半径
矩形：长

fRangeY:影响范围Y:作者:
<影响范围Y>
扇形：角度
矩形：宽

dwCDGroup:CD时间组:作者:
成功使用某技能后，该技能相同CD时间组的所有技能都要进入相同时间的CD。
如果值为0表示为独立CD时间不影响其他的。

bRepeatUse:是否自动接普攻:<该技能是否自动循环使用>
0不
1是

dwIsBenefit:有益有害:作者:
0有害
1有益
dwForbidGroup:沉默效果分组:作者:
采用10进制累加最多5组.0不受沉默
dwSkillWeight:技能权重:作者:
在技能的释放时间内，权重高的技能可以压过权重低的技能释放，反之不行
dwSkipMoveFlag:位移技能标记:作者:
谢虹波:
0不是
1是
位移技能表示该技能在释放的时候，人物会移动到技能的作用点。这种技能需要计算技能作用点是否可以到达，并计算直线上离作用点最近的点

dwEventID:事件ID编号:作者:
1.减攻击
2.持续消耗
3.减移动速度
4.减防御
5.击退
6.击晕
7.定身
8.拉近
9.沉默
10.身法
11.暴击
20.自身增加buff
30.负面状态不执行抵抗
dwEventBuffID:事件Buff:作者:
该列用于添加BuffID
dwperiod:Buff生命周期:填写buff生命周期
dwEventLevel:事件等级:作者:
该列用于添加buff等级或击退距离
dwEventRatio:事件命中系数:作者:
该列用于添加额外命中系数 万分比
dwWhole:最大执行时间:作者:
技能使用间隔（服务器判断）
dwFrequency:技能作用次数:作者:
技能作用期间最多执行次数（服务器判断）
--]]
